import React, { Fragment } from 'react';
import { Dice, roll} from 'react-dice'
import './App.css';
import Board from './components/board'


function App() {
  return <Fragment>
    <Dice
	rolls={[roll(3, 6), roll(1, 8), roll(1, 10)]}
	showResults
	bonus={6}
/>
      <Board rows={3} cols={3} />
    </Fragment>
}

export default App;
